import React, { useEffect, useState } from 'react';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Wordcloud from './wordcloud';
import { User, PubRepo, PubPriRepo, Commit } from '../types';

export default function UserPublic() {
  const languageCounts: { [key: string]: number } = {};

  const [username, setUsername] = useState<string>('');
  const [reponame, setReponame] = useState<string>('');

  // 1. Information about the user
  const [user, setUser] = useState<User>({
    login: '',
    html_url: '',
    name: null,
    company: null,
    location: null,
    bio: null,
    public_repos: 0,
    followers: 0,
    following: 0,
    created_at: '',
    updated_at: '',
    email: '', 
    hireable: null
  });

  // 2. The public repos of a user
  const [publicrepos, setPublicrepos] = useState<PubRepo[]>([]);

  // 3. Public and private repos of a user
  const [pubprirepos, setPubprirepos] = useState<PubPriRepo[]>([]);

  // 4. The commits in a particular repo
  const [commits, setCommits] = useState<Commit[]>([]);

  // 1. Information about the user
  const fetchUserData = async () => {
    try {
      const responseUser = await fetch(`https://api.github.com/users/${username}`);
      const dataUser = await responseUser.json();
      setUser(dataUser);
    } catch (error) {
      console.error('Error fetching user data:', error);
    }
  };

  // 2. The public repos of a user
  const fetchPublicRepoData = async () => {
    try {
      const responsePublic = await fetch(`https://api.github.com/users/${username}/repos`);
      const dataPublic = await responsePublic.json();
      if (Array.isArray(dataPublic)) {
        setPublicrepos(dataPublic);
      } else {
        console.error('Expected an array but got:', dataPublic);
      }
    } catch (error) {
      console.error('Error fetching public repos data:', error);
    }
  };

  // 3. Public and private repos of a user
  const fetchPublicPrivateData = async () => {
    try {
      const responsePublicPrivate = await fetch("https://api.github.com/user/repos", {
        headers: {
          Authorization: "Bearer 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"
        }
      });
      const dataPublicPrivate = await responsePublicPrivate.json();
      console.log(dataPublicPrivate);
      if (Array.isArray(dataPublicPrivate)) {
        setPubprirepos(dataPublicPrivate);
      } else {
        console.error('Expected an array but got:', dataPublicPrivate);
      }
    } catch (error) {
      console.error('Error fetching public and private repos data:', error);
    }
  };

  // 4. The commits in a particular repo
  const fetchCommits = async () => {
    try {
      const responseCommits = await fetch(`https://api.github.com/repos/${username}/${reponame}/commits`, {
        headers: {
          Authorization: "Bearer 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"
        }
      });
      const dataCommits = await responseCommits.json();
      if (Array.isArray(dataCommits)) {
        setCommits(dataCommits);
      } else {
        console.error('Expected an array but got:', dataCommits);
      }
    } catch (error) {
      console.error('Error fetching commits data:', error);
    }
  };

  // Button to retrieve data from the API
  const handleButtonClick = () => {
    if (username.trim() !== '') {
      fetchUserData();
      fetchPublicRepoData();
      fetchPublicPrivateData();
    } else {
      alert('Please enter a GitHub username.');
    }
  };

  const handleButtonClick2 = () => {
    if (reponame.trim() !== '' && username.trim() !== '') {
      fetchCommits();
    } else {
      alert('Please enter a GitHub username and repository name.');
    }
  };

  return (
    <div>
      <h1>GitHub Repositories for {username}</h1>
      <TextField
        label="Enter GitHub Username"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
      />
      <Button variant="contained" onClick={handleButtonClick}>
        Fetch Repositories
      </Button>
      <TextField
        label="Enter GitHub Reponame"
        value={reponame}
        onChange={(e) => setReponame(e.target.value)}
      />
      <Button variant="contained" onClick={handleButtonClick2}>
        Fetch repo under this user
      </Button>

      <ul>
        <li>Login: {user.login}</li>
        <li>Name: {user.name || 'N/A'}</li>
        <li>Profile URL: <a href={user.html_url}>{user.html_url}</a></li>
        <li>Company: {user.company || 'N/A'}</li>
        <li>Location: {user.location || 'N/A'}</li>
        <li>Bio: {user.bio || 'N/A'}</li>
        <li>Public Repositories: {user.public_repos}</li>
        <li>Followers: {user.followers}</li>
        <li>Following: {user.following}</li>
        <li>Joined GitHub: {user.created_at}</li>
        <li>Last Updated: {user.updated_at}</li>
        <li>Email: {user.email || 'N/A'}</li>
        <li>Hireable: {user.hireable ? 'Yes' : 'No'}</li>
      </ul>

      <ul>
        {Array.isArray(publicrepos) && publicrepos.slice(0, 2).map((publicrepo) => (
          <li key={publicrepo.name}>
            <h3>{publicrepo.name}</h3>
            <p>Full Name: {publicrepo.full_name}</p>
            <p>Private: {publicrepo.private.toString()}</p>
            <p>HTML URL: {publicrepo.html_url}</p>
            <p>Description: {publicrepo.description || 'N/A'}</p>
            <p>Fork: {publicrepo.fork.toString()}</p>
            <p>URL: {publicrepo.url}</p>
            <p>Created At: {publicrepo.created_at}</p>
            <p>Updated At: {publicrepo.updated_at}</p>
            <p>Pushed At: {publicrepo.pushed_at}</p>
            <p>Homepage: {publicrepo.homepage || 'N/A'}</p>
            <p>Size: {publicrepo.size}</p>
            <p>Stargazers Count: {publicrepo.stargazers_count}</p>
            <p>Watchers Count: {publicrepo.watchers_count}</p>
            <p>Language: {publicrepo.language || 'N/A'}</p>
            <p>Has Issues: {publicrepo.has_issues.toString()}</p>
            <p>Has Projects: {publicrepo.has_projects.toString()}</p>
            <p>Has Downloads: {publicrepo.has_downloads.toString()}</p>
            <p>Has Wiki: {publicrepo.has_wiki.toString()}</p>
            <p>Has Pages: {publicrepo.has_pages.toString()}</p>
            <p>Has Discussions: {publicrepo.has_discussions.toString()}</p>
            <p>Forks Count: {publicrepo.forks_count}</p>
            <p>Mirror URL: {publicrepo.mirror_url || 'N/A'}</p>
            <p>Archived: {publicrepo.archived.toString()}</p>
            <p>Disabled: {publicrepo.disabled.toString()}</p>
            <p>Open Issues Count: {publicrepo.open_issues_count}</p>
            <p>License: {publicrepo.license || 'N/A'}</p>
            <p>Web Commit Signoff Required: {publicrepo.web_commit_signoff_required.toString()}</p>
            <p>Topics: {publicrepo.topics.join(', ')}</p>
            <p>Visibility: {publicrepo.visibility}</p>
            <p>Forks: {publicrepo.forks}</p>
            <p>Open Issues: {publicrepo.open_issues}</p>
            <p>Watchers: {publicrepo.watchers}</p>
            <p>Default Branch: {publicrepo.default_branch}</p>
          </li>
        ))}
      </ul>

      <ul>
        {Array.isArray(pubprirepos) && pubprirepos.slice(0, 3).map((pubprirepo) => (
          <li key={pubprirepo.name}>
            <h3>{pubprirepo.name}</h3>
            <p>Full Name: {pubprirepo.full_name}</p>
            <p>Private: {pubprirepo.private.toString()}</p>
            <p>HTML URL: {pubprirepo.html_url}</p>
            <p>Description: {pubprirepo.description || 'N/A'}</p>
            <p>Fork: {pubprirepo.fork.toString()}</p>
            <p>URL: {pubprirepo.url}</p>
            <p>Created At: {pubprirepo.created_at}</p>
            <p>Updated At: {pubprirepo.updated_at}</p>
            <p>Pushed At: {pubprirepo.pushed_at}</p>
            <p>Homepage: {pubprirepo.homepage || 'N/A'}</p>
            <p>Size: {pubprirepo.size}</p>
            <p>Stargazers Count: {pubprirepo.stargazers_count}</p>
            <p>Watchers Count: {pubprirepo.watchers_count}</p>
            <p>Language: {pubprirepo.language || 'N/A'}</p>
            <p>Has Issues: {pubprirepo.has_issues.toString()}</p>
            <p>Has Projects: {pubprirepo.has_projects.toString()}</p>
            <p>Has Downloads: {pubprirepo.has_downloads.toString()}</p>
            <p>Has Wiki: {pubprirepo.has_wiki.toString()}</p>
            <p>Has Pages: {pubprirepo.has_pages.toString()}</p>
            <p>Has Discussions: {pubprirepo.has_discussions.toString()}</p>
            <p>Forks Count: {pubprirepo.forks_count}</p>
            <p>Mirror URL: {pubprirepo.mirror_url || 'N/A'}</p>
            <p>Archived: {pubprirepo.archived.toString()}</p>
            <p>Disabled: {pubprirepo.disabled.toString()}</p>
            <p>Open Issues Count: {pubprirepo.open_issues_count}</p>
            <p>License: {pubprirepo.license || 'N/A'}</p>
            <p>Web Commit Signoff Required: {pubprirepo.web_commit_signoff_required.toString()}</p>
            <p>Topics: {pubprirepo.topics.join(', ')}</p>
            <p>Visibility: {pubprirepo.visibility}</p>
            <p>Forks: {pubprirepo.forks}</p>
            <p>Open Issues: {pubprirepo.open_issues}</p>
            <p>Watchers: {pubprirepo.watchers}</p>
            <p>Default Branch: {pubprirepo.default_branch}</p>
            <p>Permissions:</p>
            <ul>
              <li>Admin: {pubprirepo.permissions.admin.toString()}</li>
              <li>Maintain: {pubprirepo.permissions.maintain.toString()}</li>
              <li>Push: {pubprirepo.permissions.push.toString()}</li>
              <li>Triage: {pubprirepo.permissions.triage.toString()}</li>
              <li>Pull: {pubprirepo.permissions.pull.toString()}</li>
            </ul>
          </li>
        ))}
      </ul>

      <div>
        {/* Conditionally render some elements if both username and reponame are not empty */}
        {username.trim() !== '' && reponame.trim() !== '' && (
          <div>
            {/* Render the elements here */}
            <ul>
              {commits.map((commit: Commit) => (
                <li key={commit.sha}>
                  <p>SHA: {commit.sha}</p>
                  <p>Node ID: {commit.node_id}</p>
                  <p>Commit Author Name: {commit.commit.author.name}</p>
                  <p>Commit Author Email: {commit.commit.author.email}</p>
                  <p>Commit Author Date: {commit.commit.author.date}</p>
                  <p>Committer Name: {commit.commit.committer.name}</p>
                  <p>Committer Email: {commit.commit.committer.email}</p>
                  <p>Committer Date: {commit.commit.committer.date}</p>
                  <p>Commit Message: {commit.commit.message}</p>
                  <p>Commit Tree SHA: {commit.commit.tree.sha}</p>
                  <p>Commit Tree URL: {commit.commit.tree.url}</p>
                  <p>Commit URL: {commit.commit.url}</p>
                  <p>Comment Count: {commit.commit.comment_count}</p>
                  <p>Verification Verified: {commit.commit.verification.verified.toString()}</p>
                  <p>Verification Reason: {commit.commit.verification.reason}</p>
                  <p>Verification Signature: {commit.commit.verification.signature || 'N/A'}</p>
                  <p>Verification Payload: {commit.commit.verification.payload || 'N/A'}</p>
                  <p>Commit URL: {commit.url}</p>
                  <p>HTML URL: {commit.html_url}</p>
                  <p>Comments URL: {commit.comments_url}</p>
                  <p>Author Login: {commit.author.login}</p>
                  <p>Author URL: {commit.author.url}</p>
                  <p>Author HTML URL: {commit.author.html_url}</p>
                  <p>Author Type: {commit.author.type}</p>
                  <p>Author Site Admin: {commit.author.site_admin.toString()}</p>
                  <p>Committer Login: {commit.committer.login}</p>
                  <p>Committer URL: {commit.committer.url}</p>
                  <p>Committer HTML URL: {commit.committer.html_url}</p>
                  <p>Committer Type: {commit.committer.type}</p>
                  <p>Committer Site Admin: {commit.committer.site_admin.toString()}</p>
                </li>
              ))}
            </ul>
          </div>
        )}
      </div>

      <Wordcloud userData={user} userLanguage={languageCounts} />
    </div>
  );
}
